import "./Home.scss";

const Home = () => {
  return (
    <div className="home">
      <h1>Kellyn Dassler</h1>
      <h2>Personal Website</h2>
      <ul>
        <li><a href="google.com">Page One</a></li>
      </ul>
    </div>
  )
}

export default Home;
